import React from 'react'
import './skills.css'
import skill from '../../assets/skill.jpg';
import education from '../../assets/education.png';


const Skills = () => {
  return (
 <section id="skills">
   <span className="skillTitle">About Me</span>
   <span className="skillDesc">I completed my graduation in 2023. I'm aware of different coding languages like java,python,c,c++,etc. I also completed a full stack java course recently.Now I'm a skilled web designer.</span>
 </section>
  
  );
}

export default Skills
